import axios from 'axios';

const USER_API_BASE_URL="http://localhost:8000/";
class LogoutService{
    logout(){
        return axios.post(USER_API_BASE_URL+'Logout',{
            headers:{
                'Content-Type':'application/json'
            }
        });
    }

}
export default new LogoutService();
